import React, { Component } from "react";
import Wrapper from "../components/Wrapper";
import NavBarRecipe from "../components/CategoriesPage/NavBar";
import Ingredients from "../components/CategoriesPage/SearchRecipe";
import FindRecipes from "../components/CategoriesPage/FindRecipe";
import Footer from "../components/CategoriesPage/Footer";

class Recipe extends Component {
    state = {
        isDairyClicked: false,
        isMeatClicked: false,
        isVeggiesClicked: false,
        isPantryClicked: false,
        isSeafoodClicked: false,
        isFruitClicked: false
    }

    dairyClicked = () => {
        this.setState({
            isDairyClicked: true
        })
    }


    render() {
        return (
            <Wrapper>
                <NavBarRecipe/>
                <Ingredients
                />
                <FindRecipes/>
                <Footer/>
            </Wrapper>

        );
    }
}

export default Recipe;
